self.addEventListener('install',(event)=>{console.log('install');self.skipWaiting();event.waitUntil(caches.open('v11').then((cache)=>{return cache.addAll(['/albertforfuture.de/custom.min.css','/albertforfuture.de/logo.min.svg','https://mohe2015.github.io/albertforfuture.de/bundle.js','https://mohe2015.github.io/albertforfuture.de/sw.min.js','/albertforfuture.de/manifest.min.json','https://mohe2015.github.io/albertforfuture.de//offline/',]);}));});self.addEventListener('activate',event=>{console.log('activate_');self.clients.claim();event.waitUntil(caches.keys().then(function(cacheNames){return Promise.all(cacheNames.filter(function(cacheName){return cacheName!=='v11';}).map(function(cacheName){return caches.delete(cacheName);}));}));});self.addEventListener('fetch',(event)=>{var pathname=new URL(event.request.url).pathname;event.respondWith(caches.match(event.request).then(cacheResponse=>{return cacheResponse||fetch(event.request).then(response=>{return caches.open('v11').then(cache=>{cache.put(event.request,response.clone());return response;});}).catch(error=>{return caches.match('/offline/').then(function(response){return response;});});}))});self.addEventListener('notificationclose',event=>{const notification=event.notification;console.log(event.notification)
const primaryKey=notification.data.primaryKey;console.log('Closed notification: '+primaryKey);});self.addEventListener('notificationclick',event=>{const notification=event.notification;console.log(event.notification)
const primaryKey=notification.data.primaryKey;const action=event.action;if(action==='close'){notification.close();}else{event.waitUntil(clients.matchAll().then(clis=>{const client=clis.find(c=>{return c.visibilityState==='visible';});if(client!==undefined){client.navigate('/?'+primaryKey);client.focus();}else{clients.openWindow('/?'+primaryKey);notification.close();}}));}
self.registration.getNotifications().then(notifications=>{notifications.forEach(notification=>{notification.close();});});});self.addEventListener('push',event=>{let body;if(event.data){body=event.data.text();}else{body='Default body';}
console.log(body)
const options={body:body,icon:'https://mohe2015.github.io/albertforfuture.de/logo.min.svg',data:{dateOfArrival:Date.now(),primaryKey:1}};event.waitUntil(clients.matchAll().then(c=>{console.log(c);self.registration.showNotification('Push Notification',options);}));});